        return False
    else:
        concat_count = len(string) // len(concat_str)
        if string == concat_str * concat_count:
            return True
        else:
            return False

def solve(s, concat):
    if len(s) % len(concat) != 0:
        return False
    for i in range(len(s) // len(concat)):
        if s[i * len(concat) : (i + 1) * len(concat)] != concat:
            return False
    return True
